import React , {Component} from 'react'
import Child from './Child'

class App extends Component{
    data = {
        name : 'Sayed',
        age : 21
    }
    Hello = () => console.log(this.state.name);

    Change = () => {
        this.setState({
            name : 'Ahmed'
        })
    }

    render(){
        return(
            <div>
                <Child />
                <button onClick={this.Hello}>Hello</button>
                <button onClick={this.Change}>Change</button>
            </div>
        );
    }
}

export default App
